import React, {useState} from 'react'

const ToDoList = () => {
    const [tasks, setTasks] = useState([
        {title: 'Buy bread'},
        {title: 'Celebrate'},
        {title: 'Create site'}
    ])
    return (
        <div>
          <ul>
              {tasks.map((el, i)=>{
                  return <li key={i}>{el.title}</li>
              })}
          </ul>
        </div>
    )
}

export default ToDoList
